import React from 'react';

class App extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <header>
          <p>
            Yummy
          </p>
        </header>
        <button>
          Create a Group
        </button>
        <button>
          Join a Group
        </button>
      </div>
    )
  }
}


export default App;
